  mediump vec4 cc_fogBase;
  mediump vec4 cc_fogAdd;
  mediump vec4 cc_nearFar;
  mediump vec4 cc_viewPort;
};
layout(location = 0) in vec2 v_uv;
layout(set = 1, binding = 2) uniform sampler2D mainTexture;
layout(set = 1, binding = 0) uniform Constant {
  vec4 mainColor;
};
#define M_PI 3.14159265358979323846
#define MAX_ARR_LEN 6
layout(set = 1, binding = 1) uniform Properties {
  vec4 color0;
  vec4 color1;
  vec4 color2;
  vec4 color3;
  vec4 color4;
  vec4 color5;
  float height0;
  float height1;
  float height2;
  float height3;
  float height4;
  float height5;
  float skewAngle;
  float waveType;
  int layerNum;
  float sizeRatio;
};
vec2 tranPt(vec2 uv,float angle,vec2 center){
  float c = cos(angle);
  float s = sin(angle);
  float Ox = center.x;
  float Oy = center.y;
  mat3 m = mat3(
        c,0.0-s,(1.0-c)*Ox+s*Oy,
        s,c,(1.0-c)*Oy-s*Ox,
        0.0,0.0,1.0
  );
  vec3 ret = m*vec3(uv.x,uv.y,0.0);
  return ret.xy;
}
vec2 getCenter(float angle,float _height){
  float ratio = sizeRatio;
  bool toLeft = sin(angle)>=0.0;
  vec2 center = vec2(0.5,1.0-_height);
  float _t = abs(tan(angle));
  if(_height<0.5){
    bool is_bottom = _t/ratio>2.0*_height;
    if(is_bottom){
      center.x = sqrt(2.0*_height/_t*ratio)/2.0;
      center.y = 1.0 - sqrt(2.0*_height*_t/ratio)/2.0;
      bool is_top = _t>(ratio)/(_height*2.0);
      if(is_top){
        center.y = 0.5;
        center.x = _height;
      }
    }
    if(!toLeft){
      center.x = 1.0-center.x;
    }
  }else{
    bool is_top = _t>2.0*ratio*(1.0-_height);
    if(is_top){
      center.x = sqrt(2.0*ratio*(1.0-_height)/_t)/2.0;
      center.y = sqrt(2.0*ratio*(1.0-_height)*_t)/2.0/ratio;
      bool is_bottom = _t>ratio/(2.0*(1.0-_height));
      if(is_bottom){
        center.y = 0.5;
        center.x = 1.0-_height;
      }
    }
    if(toLeft){
      center.x = 1.0-center.x;
    }
  }
  return center;
}
float drawWater(vec2 uv,float angle,float _height,int arrSize,int curIdx)
{
  float ratio = sizeRatio;
  bool toLeft = sin(angle)>=0.0;
  vec2 center = getCenter(angle,_height);
  uv.y = uv.y*ratio;
  uv -= vec2(center.x,center.y*ratio);
  vec2 uv1 = tranPt(uv,angle,vec2(0.0));
  float y = 0.0;
  bool hasWave = curIdx==arrSize-1;
  hasWave = hasWave;
  if(hasWave){
    float amplitude = 0.0;
    float angularVelocity = 0.0;
    float frequency = 0.0;
    if(abs(waveType-1.0)<0.01){
      amplitude = 0.06;
      angularVelocity = 10.0;
      frequency = 10.0;
    }else if(abs(waveType-2.0)<0.01){
      amplitude = 0.03;
      angularVelocity = 5.0;
      frequency = 6.0;
    }
    y = amplitude * sin((angularVelocity * uv1.x) + (frequency * cc_time.x)*(toLeft ? 1. : -1.));
  }
  float alpha = (uv1.y > y) ? 1.0 : 0.0;
  return alpha;
}
vec4 frag () {
  vec4 ret = vec4(1.0,1.0,1.0,1.0);
  ret *= texture(mainTexture, v_uv);
  if(ret.a == 0.0){
    discard;
  }
  float angle = skewAngle;
  vec2 uv = vec2(v_uv);
  float a = 0.0;
  float _height = 0.0;
  vec4 colors[6];
  float heights[6];
  colors[0] = color0; colors[1] = color1; colors[2] = color2; colors[3] = color3; colors[4] = color4; colors[5] = color5;
  heights[0] = height0; heights[1] = height1; heights[2] = height2; heights[3] = height3; heights[4] = height4; heights[5] = height5;
  int size = 0;
  for(int i=0;i<MAX_ARR_LEN;i++){
    if(heights[i]<0.001){
      continue;
    }
    size++;
  }
  for(int i=0;i<MAX_ARR_LEN;i++){
    if(heights[i]<0.001){
      continue;
    }
    _height+=heights[i];
    a += drawWater(uv,angle,_height,size,i);
    if(a>0.0){
        ret *= a*colors[i];
        break;
    }
  }
  if(a<0.001){
    discard;
  }
  return ret;
}
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }
